import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';

function Nav() {


    return (
        <nav>

                <h1 className="navTitle">Dark Shop</h1>

            <ul className="nav-links">

                    <li>Home</li>


                    <li>Catalog</li>


                    <li>Cart</li>

            </ul>
        </nav>
    );
}

export default Nav;
